INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (1, 13, 1, N'Faltou realizar uma situação didática');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (2, 14, 1, N'O município precisa ainda fortalecer as práticas formativas.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (3, 14, 2, N'Para os professores da Educação Infantil, não houve formação externa com o ICEP');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (4, 14, 3, N'Ainda precisamos fortalecer os acompanhamentos');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (5, 14, 4, N'No próximo ano iremos ampliar a formação para a Educação Infantil');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (6, 15, 1, N'Percebe-se uma qualificação nos acompanhamentos a partir das formações, entretanto ainda há muitos pontos a serem ajustados, como a periodicidade, foco, registro e feedback.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (7, 15, 2, N'Todas as escolas tem o PIL elaborado, porém nem todas realizam as ações de fato com um cronograma anual e o projeto ainda conta com alguns equívocos.  Chegar em 2026 com a formação mais cedo. Chegamos já no II Semestre.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (8, 15, 3, N'A realização de formação de professores pelo coordenador é uma prática fragilizada na rede. É uma dificuldade dos anos finais de realizar a formação dos professores, o horário é um dos complicadores. Os professores não se sentem “obrigados” a ir ao AC. O dia do AC é compreendido como dia “de folga”. Secretária já fez comunicado e não muda. Realidade não é a mesma para Anos Iniciais e Educação infantil, onde somente alguns coordenadores não realizam.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (9, 15, 4, N'Houve a escrita do Plano anual, mas ele passou por mudanças a partir das concepções que o Icep traz, esses estudos do novo plano ainda não foram concluídos.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (10, 15, 5, N'Mais fortalecidos em umas escolas e menos em outras. Poucas escolas (por volta de 30%) trabalham com projetos e sequências. Foi tratado na formação. Mas as escolas mais presentes conseguiram fazer mais e melhor.  A escola tem dificuldade de integrar a formação e o currículo escolar.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (11, 15, 6, N'Houve mudanças em virtude da formação externa,  das sequências didáticas em algumas escolas. Os professores que apresentavam resistência, hoje é possível notar a mudança na prática desses professores. Formação ajudou a modificar a prática.  Porém, não em todas as escolas.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (12, 16, 1, N'Os acompanhamentos e monitoramentos precisam ser fortalecidos');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (13, 16, 2, N'O PIB ainda precisa intensificar, principalmente nas escolas da zona rural');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (14, 16, 3, N'Precisando intensificar os acompanhamentos diretos as salas de aula');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (15, 16, 4, N'Precisando ainda, assegurar em todas as escolas');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (16, 16, 6, N'Considerando a necessidade de um trabalho mais qualificado, em projeto interdisciplinares,  os anos finais precisam ainda, fortalecer as práticas sociais de leitura e escrita em todas as áreas');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (17, 17, 1, N'O processo de Formação de Iraquara aconteceu com encontros mensais de cada público.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (18, 17, 3, N'Precisa seguir avançando no registro dos acompanhamentos de forma mais sistemática');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (19, 17, 4, N'A rede vem avançando nas rotinas que garantem as práticas sociais de leitura e escrita e do brincar.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (20, 17, 5, N'É importante garantir o envio das situações didáticas no início do ano - a de entrada- e de saída -em setembro -, a fim de promover melhores aprendizagens. Outra ponto importante é seguir a mesma rubrica, não acrescentando novas questões que não articula com a ficha de tabulação.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (21, 18, 1, N'Devido a quantidade de escolas da rede, não foi possível acompanhar com frequência. Porém, percebemos a necessidade de maiores investimentos nessa prática em 2026.');
INSERT INTO dbo.ComentarioIndicador (id, municipio_id, ambito_gestao_id, comentario) VALUES (22, 19, 1, N'Em 2025 houve um avanço significativo nos acompanhamentos na rede.');
